// File: FormFieldsComponent.js

import React, { useEffect, useState } from 'react';
import fetchFormData from './utils';
import parseFormFields from './utils';

const FormFieldFetcher = () => {
  const [formFields, setFormFields] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const htmlContent = await fetchFormData('https://docs.google.com/forms/d/e/1FAIpQLSdX7VTdsVsNeFu3GPxNcRAP6dziAaeXzZyYjHaXLgIDf_kuPQ/viewform?usp=sf_link');
        const fields = parseFormFields(htmlContent);
        setFormFields(fields);
      } catch (error) {
        // Handle error
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2>Form Fields:</h2>
      <ul>
        {formFields.map((field, index) => (
          <li key={index}>{`${field.type} - ${field.name}`}</li>
        ))}
      </ul>
    </div>
  );
};

export default FormFieldFetcher;
